    body::-webkit-scrollbar,
    html::-webkit-scrollbar {
      display: none;
    }

    #content::-webkit-scrollbar {
      height: 0;
      width: 0;
    }

    .clip {
      clip-path: inset(0 50% 0 0);
    }

    .pulse-button {
      cursor: pointer;
      animation: pulse 1s infinite;
    }

    @keyframes pulse {
      0% {
        transform: scale(1);
      }

      50% {
        transform: scale(1.1);
      }

      100% {
        transform: scale(1);
      }
    }

    .clickAnimation {
      animation: swipeHide 5s infinite;
    }

    @keyframes swipeHide {
      0% {
        transform: translateX(0%);
        opacity: 1;
      }

      25% {
        opacity: 0;
        transform: translateX(-200%);
      }

      50%,
      75%,
      100% {
        opacity: 0;
      }
    }

    @media only screen and (orientation: landscape) {
      .after_text {
        width: 25%;
      }

      .before_text {
        width: 30%;
      }
    }
  </style>
</head>

  <main id="main" class="bg-white flex h-screen w-full max-w-[100%] overflow-hidden">
    <section id="content" class="overflow-y-scroll w-full">
      <section
        class="slider h-[100%] w-[full] landscape:w-[80%] flex flex-col items-center justify-center mx-auto relative">
        <section class="overflow-hidden h-full flex w-full flex-col items-center relative">
          <div class="relative h-full w-full landscape:max-w-[80%]">

            <div class="relative w-full h-full pointer-events-none ">
              <img class="after w-full h-full object-cover">
              <img class="after_text absolute bottom-[20%] right-[5%] w-[24%]">
            </div>
            <div class="relative clip after-image w-full h-full  pointer-events-none  -translate-y-[100%]">
              <img class="before w-full h-full object-cover">
              <img class="before_text absolute bottom-[20%] right-[5%] w-[30%]">
            </div>
            <div class="handle w-[2%] cursor-ew-resize bg-white h-full absolute top-0 left-[50%]"></div>
            <img class="click clickAnimation absolute top-[20%] right-[30%] ">
            <div
              class="flex absolute top-0 landscape:-top-[3%] right-[0%] w-full justify-center items-center pt-[30px] mb-[25px] ">
              <img class="logo max-w-[20%] w-[300px]" alt="ILIA_LOGO">
            </div>
          </div>
        </section>
      </section>
    </section>
    <div class="p-5 w-full fixed bottom-0 mx-auto">
      <button class="cta w-full flex justify-center mx-auto pulse-button " onclick="mraid.open()">
        <img class="w-full max-w-[300px] btn-shopnow " alt="Shop Now">
      </button>
    </div>
  </main>
  <!-- SWIPE -->
  <script>
    const slider = document.querySelector('.slider');
    const handle = document.querySelector('.handle');
    const afterImage = document.querySelector('.after-image');

    slider.addEventListener('mousemove', (e) => {
      const sliderRect = slider.getBoundingClientRect();
      const offsetX = e.clientX - sliderRect.left;
      const sliderWidth = sliderRect.width;

      // Calculate the percentage of the slider hovered
      const percentage = (offsetX / sliderWidth) * 100;

      // Update styles
      handle.style.left = `${percentage}%`;
      afterImage.style.clipPath = `inset(0 ${100 - percentage}% 0 0)`;
    });

    slider.addEventListener('touchmove', (e) => {
      const touch = e.touches[0];
      const sliderRect = slider.getBoundingClientRect();
      const offsetX = touch.clientX - sliderRect.left;
      const sliderWidth = sliderRect.width;

      // Calculate the percentage of the slider hovered
      const percentage = (offsetX / sliderWidth) * 100;

      // Update styles
      handle.style.left = `${percentage}%`;
      afterImage.style.clipPath = `inset(0 ${100 - percentage}% 0 0)`;
    });
  </script>
  <!-- CTA -->
  <script>
    (function () {
      const mraid = window.mraid || {};
      let isViewable = false;
      let scrollInterval;
      let isAutoScrolling = true;

      // Configuration Constants
      const SCROLL_SPEED = 1; // Pixels per tick
      const SCROLL_INTERVAL = 50; // Milliseconds
      const FALLBACK_DELAY = 1000; // Delay for non-MRAID environments
      const content = document.getElementById("content");

      // Utility: Starts auto-scrolling
      const startAutoScroll = () => {
        if (!isAutoScrolling) return;
        scrollInterval = setInterval(() => {
          content.scrollTop += SCROLL_SPEED;
          if (content.scrollHeight - content.scrollTop <= content.clientHeight) {
            content.scrollTop = 0; // Reset scroll to top
          }
        }, SCROLL_INTERVAL);
      };

      // Utility: Stops auto-scrolling
      const stopAutoScroll = () => {
        isAutoScrolling = false;
        clearInterval(scrollInterval);
      };

      // Utility: Handles click actions
      const handleClickAction = () => {
        if (mraid.open && typeof mraid.open === "function") {
          mraid.open();
        } else {
          window.open();
        }
      };

      // Add click event listeners to specified selectors
      const addClickHandlers = (selectors) => {
        selectors.forEach(selector => {
          document.querySelectorAll(selector).forEach(element => {
            element.addEventListener("click", (e) => {
              e.preventDefault();
              handleClickAction();
            });
          });
        });
      };

      // Initialize scrolling and content visibility
      const initializeScrolling = () => {
        content.style.display = "block"; // Ensure content is visible
        if (isViewable && mraid.isViewable && typeof mraid.isViewable === "function" && mraid.isViewable()) {
          startAutoScroll();
        }
      };

      // Initialize MRAID functionality
      const initializeMraid = () => {
        if (mraid && typeof mraid.getState === "function") {
          const state = mraid.getState();
          if (state === "loading") {
            mraid.addEventListener("ready", () => {
              isViewable = true;
              initializeScrolling();
            });
          } else {
            isViewable = true;
            initializeScrolling();
          }
        } else {
          // Fallback for non-MRAID environments
          setTimeout(initializeScrolling, FALLBACK_DELAY);
        }
      };

      // Add user interaction event listeners to stop auto-scrolling
      const addUserInteractionListeners = () => {
        ["touchstart", "mousedown", "wheel"].forEach(eventType => {
          content.addEventListener(eventType, stopAutoScroll, { passive: true });
        });
      };

      // Initialization logic
      const initialize = () => {
        addClickHandlers([".cta"]);
        addUserInteractionListeners();
        initializeMraid();
      };

      // Start initialization when the DOM is ready
      if (document.readyState === "loading") {
        document.addEventListener("DOMContentLoaded", initialize);
      } else {
        initialize();
      }
    })();
  </script>
